sap.ui.define(['sap/ui/webc/common/thirdparty/base/renderer/LitRenderer'], function (litRender) { 'use strict';

	const block0 = (context, tags, suffix) => litRender.html`<div class="ui5-uc-root" role="region" aria-roledescription="${litRender.ifDefined(context._roleDescription)}" @drop="${context._ondrop}"><div class="ui5-uc-header"><slot name="header"></slot></div><div class="${litRender.classMap(context.classes.content)}"><${litRender.scopeTag("ui5-list", tags, suffix)} mode="${litRender.ifDefined(context.mode)}" @ui5-selection-change="${litRender.ifDefined(context._onSelectionChange)}" @ui5-item-delete="${litRender.ifDefined(context._onItemDelete)}"><slot></slot></${litRender.scopeTag("ui5-list", tags, suffix)}>${ context._showNoData ? block1(context, tags, suffix) : block2(context, tags, suffix) }</div></div>`;
	const block1 = (context, tags, suffix) => litRender.html`<div class="uc-no-files"><div class="icon-container"><${litRender.scopeTag("ui5-icon", tags, suffix)} name="document"></${litRender.scopeTag("ui5-icon", tags, suffix)}></div><${litRender.scopeTag("ui5-title", tags, suffix)} level="H2" wrapping-type="Normal">${litRender.ifDefined(context._noDataText)}</${litRender.scopeTag("ui5-title", tags, suffix)}><${litRender.scopeTag("ui5-label", tags, suffix)} class="subtitle" wrapping-type="Normal">${litRender.ifDefined(context._noDataDescription)}</${litRender.scopeTag("ui5-label", tags, suffix)}></div>`;
	const block2 = (context, tags, suffix) => litRender.html`${ context._showDndOverlay ? block3(context, tags, suffix) : undefined }`;
	const block3 = (context, tags, suffix) => litRender.html`<div class="${litRender.classMap(context.classes.dndOverlay)}" @dragenter="${context._ondragenter}" @dragleave="${context._ondragleave}" @dragover="${context._ondragover}"><${litRender.scopeTag("ui5-icon", tags, suffix)} name="upload-to-cloud"></${litRender.scopeTag("ui5-icon", tags, suffix)}><span class="dnd-overlay-text">${litRender.ifDefined(context._dndOverlayText)}</span></div>`;

	return block0;

});
